import bg1 from '../../assets/image_part_001.jpg';
import bg2 from '../../assets/image_part_002.jpg';
import bg3 from '../../assets/image_part_003.jpg';
import bg4 from '../../assets/image_part_004.jpg';

import Modal from '../../UI/Modal/Modal';

const main = (props) => {
    return (

        <section className={classes.Main}>
            <section className={classes.Content} >
                <div className={classes.img1} style={{backgroundImage:'url(' + bg1 +')'}}>
                    <h3><a href="/">Income Tax</a></h3>
                </div>
                <div className={classes.img2} style={{backgroundImage:'url(' + bg2 +')'}}>
                    <h3><a href="/">GST</a></h3>
                </div>
                <div className={classes.img3} style={{backgroundImage:'url(' + bg3 +')'}}>
                    <h3><a href="/">RBI</a></h3>
                </div>
                <div className={classes.img4} style={{backgroundImage:'url(' + bg4 +')'}}>
                    <h3><a href="/">Contact Us</a></h3>
                </div>
            </section>
            <section className={classes.Description}>
            <div>
                <h1>Firm Name</h1>
                <hr></hr>
                <p> Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor 
                    incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud 
                    exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat
                </p>
            </div>
            <div className={classes.Seperator}></div>

            </section>
            <Modal click="5"><p>Modal</p><h2>Heading</h2></Modal>
        </section>

    );
}

export default main;
